import React, { Component } from 'react';

class ClientComponent extends Component{
    constructor(props){
        super(props)
        this.state={
            id:1,
            name: "asd",
            contact:"123123",
            address:"asdasd",
            numberOfEmployees: 43
        }
    }
    render(){
        return(
        <div>Client Component for id - {this.props.match.params.id}</div>
        )
    }
}

export default ClientComponent
